INSERT INTO `tipo_de_atendimento` VALUES (1,'Ressonncia magnetica na regio da cabea','00:35:00','No possui efeitos colaterais.',1000),(2,'Acupuntura','01:15:00','No possui efeitos colaterais.',23200),(3,'Cirurgia','04:35:00','Possui riscos de efeitos colaterais de perda de movimento da mo, perda do movimento dos dedos.',34400),(4,'Cirurgia Torcica','08:20:00','O principal efeito colateral da simpatectomia  o chamado efeito compensatrio. Esse efeito  descrito quando ocorrem episdios de sudorese em outras partes do corpo que no eram habituais antes da cirurgia. Habitualmente, o efeito compensatrio ocorre no tronco, pernas, abdome, coxas, virilhas, ps e glteos. O efeito compensatrio tem grande relevncia, pois seu grau de intensidade influencia diretamente a qualidade de vida do paciente.',34300),(5,'Consulta perodica','00:30:00','No possui efeitos colaterais',43300),(6,'Cirurgia Vascular','01:30:00','Possui riscos de inchao e escoriaes',34300),(7,'Fisioterapia para as pernas','00:25:00','No possui efeitos colaterais',6500),(8,'Consulta peridica','05:00:00','O paciente pode sentir dor leve no momento da puno da fstula com as agulhas. Quanto aos efeitos colaterais, no geral, os pacientes so sentem nada, mas pode ocorrer queda da presso arterial, cimbras ou dor de cabea.',54200),(9,'Quimioterapia','02:20:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',34334),(10,'Consulta','00:45:00','No possui efeitos colaterais',98700),(11,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',45700),(12,'Diagnstico e tratamento da doena renal crnica','01:50:00','No possui efeitos colaterais',64500),(13,'Cirurgia','08:15:00','As complicaes neurolgicas incluem diminuio do nvel de conscincia, vasoespasmo, convulses, hipertenso intracraniana, dficits motores, entre outros. J as complicaes sistmicas incluem nuseas e vmitos, hipotenso, desconforto respiratrio e infeco do stio cirrgico, dor e infeces nosocomiais.',2455),(14,'Consulta','00:30:00','No possui efeitos colaterais',23000),(15,'Consulta','00:25:00','No possui efeitos colaterais',23500),(16,'Consulta','00:55:00','No possui efeitos colaterais',32600),(17,'Remoo das pedras nos rins','04:15:00',' comum sentir uma dor lombar aguda, unilateral, que tende a se deslocar para as partes mais baixas do abdome. Em alguns casos, os homens tambm sofrem um desconforto nos testculos e as mulheres, nos grandes lbios.',64100),(18,'Examinao das  glndulas','00:30:00','No possui efeitos colaterais',56400),(19,'Diagnstico de doenas cardiovasculares','01:30:00','No possui efeitos colaterais',32600),(20,'Cirurgia baritrica','09:15:00','Alguns efeitos colaterais, dependendo do tipo de cirurgia, so at comuns. Nos meses imediatamente posteriores  operao, relatos de perda leve de memria, irritao e insnia tornam-se habituais em hospitais e consultrios',53600),(21,'Transplante de fgado','04:40:00','Com o uso de imunossupressores podem surgir sintomas como inchao corporal, aumento do peso, aumento da quantidade de pelos no corpo, especialmente no rosto das mulheres, osteoporose, m digesto, queda de cabelo e aftas. Assim, deve-se observar os sintomas que aparecem e conversar com o mdico para que ele indique o que se pode fazer para controlar estes sintomas desagradveis, sem prejudicar o esquema de imunossupresso.',4540),(22,'Acompanhamento mdico','00:35:00','No possui efeitos colaterais',64300),(23,'Consulta','00:50:00','No possui efeitos colaterais',64300),(24,'Ultrassom','00:25:00','No possui efeitos colaterais',98700),(25,'Cirurgia na regio bucal','00:15:00',' O edema ou inchao pode ocorrer em maior, ou menor grau dependendo da pessoa;Dor no local. Devido  interveno,  comum que o local fique bastante dolorido; Cicatrizao. O processo de cicatrizao  relativo e pode demorar mais ou menos dependendo da pessoa; Trismo; Mau hlito; Parestesia; Dores de garganta.',32400),(26,'Terapia','00:50:00','No possui efeitos colaterais',326300),(27,'Substituio de uma medula ssea','06:50:00','Nusea e vmito; Feridas na boca; Fadiga; Nveis baixos de plaquetas, dificultando a coagulao do sangue; Nveis baixos de glbulos vermelhos, causando anemia; Diarreia.',326700),(28,'Cirurgia','10:15:00','Os efeitos colaterais ps-cirrgicos costumam desaparecer por volta dos primeiros 7 a 10 dias. A maioria dos pacientes se queixa de irritao ou sensao leve de areia nos olhos, coceira e sensibilidade a luz. ',343400),(29,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, nuseas e vmitos, pele sensvel e at mesmo infertilidade.',64533);
